import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and enter XSS payload
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', '<script>alert("XSS")</script>');

    // Take screenshot after entering XSS payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_input.png'));

    // Click search button using multiple selector strategies
    const searchBtn = await page.$('.search-btn');
    if (searchBtn) {
      await searchBtn.click();
    }

    // Wait briefly for potential page changes
    await page.waitForTimeout(1000);

    // Take final screenshot after submission
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_submission.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_submission.png'));

    // Check if XSS payload appears in page content
    const pageContent = await page.content();
    const xssDetected = pageContent.includes('<script>alert("XSS")</script>');

    return {
      success: true,
      action: "Attempted XSS injection via search input with payload: <script>alert('XSS')</script>",
      extractedData: {
        xssPayloadPresent: xssDetected,
        pageTitle: await page.title()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete XSS attempt via search input",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
